import React,{useState} from "react";

function Demo1() {
  const [count, setCount] = useState(10);

  function kajal(){
    setCount(count+1);
  }

  return (
    <div className="bg-black-100">
      <div>
        <button onClick={kajal} className="bg-red-500 p-5 rounded-full flex flex-col text-center">
          Click me
        </button>
        {count}
      </div>


      <input type="text"></input>
    </div>
  );
}

export default Demo1;
